// src/components/EnrollmentDetails.js
import React from 'react';
import { Link } from 'react-router-dom';

const EnrollmentDetails = ({ location }) => {
    // Extract details from location state
    const details = location?.state?.details || {};

    return (
        <div className="enrollment-details-container">
            <h2>Enrollment Details</h2>
            <p><strong>Name:</strong> {details.name}</p>
            <p><strong>Age:</strong> {details.age}</p>
            <p><strong>Selected Batch:</strong> {details.selectedBatch}</p>
            <p><strong>Enrollment Date:</strong> {details.enrollmentDate}</p>
            <p><strong>Payment Details:</strong> {details.paymentDetails}</p>
            {/* Add more details as needed */}

            {/* Button to go back to EnrollmentForm */}
            <Link to="/enrollment-form">
                <button>Go Back to Enrollment Form</button>
            </Link>
        </div>
    );
};

export default EnrollmentDetails;
